export const loginUser = () => {
    const ab = {
        isLoggedIn: false,
        username: "gaurav",
        firstname: "gg",
        lastname: "ss",
        purchasedWidgets: [],
        cartWidgets: []
    }

    return (dispatch:any) => {
        try {
            dispatch({ type: "LOGIN_SUCCESS", payload: ab });
        } 
        catch (error) {
            console.error("error", error);
        }
    };
};
